  generator._drawCommand = drawCommand;
}

function createFramebuffer(generator, context) {
  var colorTexture = new Texture({
    context: context,
    width: 256,
    height: 256,
    pixelFormat: PixelFormat.RGBA,
    pixelDatatype: PixelDatatype.UNSIGNED_BYTE,
    sampler: Sampler.NEAREST,
  });

